Marvel 1602: Spider-Man
Written by Jeff Parker. Illustrated by Ramon Rosanas.
A return to the acclaimed universe created by Neil Gaiman and Andy Kubert kicks off as The Spider has reached manhood in the New World The young nation has grown peacefully, but Norman Osbourne's treachery finds a way to spoil the peace and put Peter's life on a new course - back to Europe. Jeff Parker Agents of Atlas] joins artist Ramon Rosanas to begin the final story of the 1602 saga

